import SongService from '../services/SongService'

class ViewSongsComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {


                 employees: [{"id":1,"firstName":"Siva","lastName":"Kumar","emailId":"WorkShiva1@gmail.com"},{"id":2,"firstName":"Siva","lastName":"Krish","emailId":"WorkShiva2@gmail.com"},{"id":3,"firstName":"Krishna","lastName":"Kumar","emailId":"Krish1@gmail.com"},{"id":4,"firstName":"Krishna","lastName":"Shiva","emailId":"Krish2@gmail.com"}]
        }

    }



    componentDidMount(){

        SongService.getSongs().then(
            (res) => {
            //this.setState({ songs: res.data});
            //this.setState({ songs: songs});

            console.log('What happened? ' + JSON.stringify(res.data));
        }
        )
